import { Component, useState } from "react";
import { Form, Button } from "antd";
import Speechtotext from "./components/component.speechtotext";
const FormItem = Form.Item;

function Test() {
  const keyword = ["เริ่มประเมิน"];
  return (
    <FormItem>
      <div>
        <h1>AAA</h1>
        <Speechtotext
          speech={"/page.covid1"}
          keyword={keyword}
          page={"covid1"}
        />
      </div>
    </FormItem>
  );
}

export default Test;
